@bot.message_handler(content_types=['document'])
def handle_document(message):
    user_id = message.from_user.id
    username = message.from_user.username

    if user_id not in AUTHORIZED_USERS and user_id not in AUTHORIZED_TEMP:
        bot.reply_to(message, "❌ لا يمكنك إرسال الملفات قبل إدخال كلمة المرور.")
        print(f"Unauthorized attempt to send a file by {username} (ID: {user_id}).")
        return

    # إذا كان المستخدم مصرح له أو أدخل كلمة المرور، استلام الملف
    file_info = bot.get_file(message.document.file_id)
    downloaded_file = bot.download_file(file_info.file_path)
    file_path = f'./{message.document.file_name}'

    with open(file_path, 'wb') as new_file:
        new_file.write(downloaded_file)

    bot.reply_to(message, "تم استلام الملف. يرجى إرسال اسم المانجا.")
    print(f"Received document from {username} (ID: {user_id}): {file_path}")

